- input: "TEXT\x1CC00396655\x1C3\x1C\x1CF3XA\x1C\"Please note that the PAC understands
    and abides by all regulations governing itemization thresholds for each type of
    transaction disclosed on this report, and every, report.  Our preference would
    have been to properly itemize all transations over $200.00 in the aggregate per
    year on Schedules A or B supporting Lines 15, 17, 21(b) and 29.  HOWEVER, the
